import React, {Component} from 'react';
import './LandingPage.css';

class Landing extends Component{
    render(){
        return(
           
            <div className="landing">
            <div id="menu">
            <img src="https://www.carthage.edu/live/image/gid/40/width/250/18567_uber-logo-2bb8ec4342-seeklogo.com.rev.1505839766.png" style={{width:"25px"}} />
            </div>
           <div id="main">
           <table style={{border:1}}>
               <tr>
                   <td>
                   <img src="https://images-platform.99static.com/xkCEp0Tdn2gBBadB_h48n1x-jek=/0x0:1181x1181/500x500/top/smart/99designs-contests-attachments/77/77055/attachment_77055612" style={{width:"75px"}} />

                   </td>
               </tr>
           </table>
           

            </div>
            
            
            </div>
            
            
            
            
        )
    }
}
export default Landing;
